import React from "react";
import { List } from "semantic-ui-react";

const TodoList = () => {
  return (
    <div className="todo-container border">
      <h4>Reminder</h4>
      <List>
        <List.Item>
          <List.Icon name="check" color="green" />
          <List.Content>Signing new business plan</List.Content>
        </List.Item>

        <List.Item>
          <List.Icon name="cancel" color="red" />
          <List.Content>Signing new business plan</List.Content>
        </List.Item>
      </List>
    </div>
  );
};

export default TodoList;
